Alfie is 26 lbs. and about 6 yrs. old or so. He is a lovable and affectionate dog. He is playful and energetic, loves people, and loves to snuggle. His owner did not want to give him up but unfortunately, due to family health problems, finds it necessary to find him a new home. He is fine in an apartment or condo, and even better in a house with a yard. Alfie is very intelligent and understands many commands. He loves to play ball and fetch doggie toys. He is usually good with kids although he can become over excited when playing with them. He is housebroken and should be walked two or three times a day.
Alfie's adoption fee is $150.
