Ritzy Rescue and Posh Puppy are programs created by CVRR to feature Purebred and Designer dogs. Many of our purebreds are rescued from local puppy mills; some are surrendered by owners who can no longer care for them. Designer dogs (blended breeds of highly desirable breeds) are sometimes found in local kill shelters, surrendered to us by backyard breeders and occasionally just dumped off near our foster homes. 
All of our Ritzy and Posh dogs are in need of loving, nurturing homes. Many of them come to us with a serious lack of socialization, malnourished, unvaccinated and desperately in need of grooming and dental care. We place them in foster homes, attend to their physical and emotional needs and begin the process of finding suitable forever homes.
&nbsp;If you are interested in providing a loving home for a Ritzy Rescue or Posh Puppy you must complete an online application at www.cvrr.us&nbsp;
We are only able to respond to interested parties who have completed applications online. Thank you.
&nbsp;
Many of our dogs can be seen at Petsmart in Visalia on Saturdays between 10 and 3.
